import Mathlib

open Filter Set TopologicalSpace
open scoped Topology

def I (X : Type) [MetricSpace X] : Set (Set X) :=
  {s | IsOpen s}

def I' (X : Type) [MetricSpace X] : Set (Set X) :=
  {s | IsClosed s}

theorem autoformalized_theorem_1809 (X : Type) [MetricSpace X] :
  ∃ (f : Set X → Set X), Function.Bijective f ∧
  ∀ s, s ∈ I X → f '' {s} ⊆ I' X :=
sorry

